        onMouseEnter={() => {
          // Only apply hover behavior on desktop (lg breakpoint and above)
          if (window.innerWidth >= 1024) {
            setCollapsed(false);
          }
        }}
        onMouseLeave={() => {
          // Only apply hover behavior on desktop (lg breakpoint and above)
          if (window.innerWidth >= 1024) {
            setCollapsed(true);
          }
        }}
      >

        {/* Clean Header */}
        <div className="relative p-4 border-b border-[#1a2332]">

          {/* Brand Logo */}
          <div className="flex items-center justify-center">
            {!collapsed && (
              <div className="flex items-center justify-center w-full">
                <img
                  src={isDarkMode ? "/assets/branding/dark background.png" : "/assets/branding/white background.png"}
                  alt="NeuroSense360 Logo"
