import React, { useState, useEffect } from 'react';
import { Upload, Play, Download, FileText, CheckCircle, Activity, User, Building2, Calendar, History, X } from 'lucide-react';
import DatabaseService from '../../services/databaseService';
import toast from 'react-hot-toast';

const AlgorithmDataProcessor = () => {
  const [patients, setPatients] = useState([]);
  const [selectedPatient, setSelectedPatient] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const [processingHistory, setProcessingHistory] = useState([]);
  const [loading, setLoading] = useState(true);

  const [eyesOpenFile, setEyesOpenFile] = useState(null);
  const [eyesClosedFile, setEyesClosedFile] = useState(null);
  const [isProcessing, setIsProcessing] = useState(false);
  const [processingComplete, setProcessingComplete] = useState(false);
  const [consoleLog, setConsoleLog] = useState([]);
  const [progress, setProgress] = useState(0);
  const [results, setResults] = useState(null);

  useEffect(() => {
    loadPatients();
  }, []);

  useEffect(() => {
    if (selectedPatient) {
      loadProcessingHistory(selectedPatient.id);
    }
  }, [selectedPatient]);

  const loadPatients = async () => {
    try {
      const patientsData = await DatabaseService.get('patients');
      const clinicsData = await DatabaseService.get('clinics');

      // Enrich patients with clinic names
      const enrichedPatients = patientsData.map(patient => ({
        ...patient,
        clinicName: clinicsData.find(c => c.id === patient.clinicId)?.name || 'Unknown Clinic'
      }));

      setPatients(enrichedPatients);
      setLoading(false);
    } catch (error) {
      console.error('Error loading patients:', error);
      toast.error('Failed to load patients');
      setLoading(false);
    }
  };

  const loadProcessingHistory = async (patientId) => {
    try {
      // Load algorithm results for this patient
      const results = await DatabaseService.get('algorithmResults');
      const patientResults = results.filter(r => r.patientId === patientId);
      setProcessingHistory(patientResults);
    } catch (error) {
      console.error('Error loading processing history:', error);
      setProcessingHistory([]);
    }
  };

  const handlePatientSelect = (patient) => {
    setSelectedPatient(patient);
    setSearchTerm('');
    // Reset upload states
    setEyesOpenFile(null);
    setEyesClosedFile(null);
    setResults(null);
    setProcessingComplete(false);
    setConsoleLog([]);
  };

  const handleClearSelection = () => {
    setSelectedPatient(null);
    setSearchTerm('');
    setEyesOpenFile(null);
    setEyesClosedFile(null);
    setResults(null);
    setProcessingComplete(false);
    setConsoleLog([]);
    setProcessingHistory([]);
  };

  const filteredPatients = patients.filter(patient =>
    patient.name?.toLowerCase().includes(searchTerm.toLowerCase()) ||
    patient.email?.toLowerCase().includes(searchTerm.toLowerCase()) ||
    patient.clinicName?.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleFileUpload = (type, event) => {
    const file = event.target.files[0];
    if (file) {
      if (type === 'eo') {
        setEyesOpenFile(file);
      } else {
        setEyesClosedFile(file);
      }
      // Reset processing state when new files are uploaded
      setProcessingComplete(false);
      setResults(null);
      setConsoleLog([]);
      setProgress(0);
    }
  };

  const simulateProcessing = async () => {
    setIsProcessing(true);
    setConsoleLog([]);
    setProgress(0);

    const steps = [
      { message: 'Parsing 2 activities...', delay: 800 },
      { message: 'Applying Binary Scoring Logic...', delay: 1000 },
      { message: 'Calculating Sub-Parameters...', delay: 1200 },
      { message: 'Decoding sub-parameters...', delay: 900 },
      { message: 'Finalizing Score...', delay: 1100 },
      { message: 'Applying Binary Scoring Logic...', delay: 800 }
    ];

    for (let i = 0; i < steps.length; i++) {
      await new Promise(resolve => setTimeout(resolve, steps[i].delay));
      setConsoleLog(prev => [...prev, steps[i].message]);
      setProgress(((i + 1) / steps.length) * 100);
    }

    // Generate results
    const finalResults = [
      { parameter: 'Focus & Attention', score: 88, status: 'Normal', color: 'blue' },
      { parameter: 'Stress', score: 67, status: 'Elevated', color: 'orange' },
      { parameter: 'Emotional Regulation', score: 45, status: 'Abnormal', color: 'red' },
      { parameter: 'Cognitive Flexibility', score: 90, status: 'Normal', color: 'green' },
      { parameter: 'Mood Stability', score: 78, status: 'Normal', color: 'green' },
      { parameter: 'Sleep Quality', score: 35, status: 'Abnormal', color: 'orange' },
      { parameter: 'Social Engagement', score: 82, status: 'Normal', color: 'green' }
    ];

    setResults(finalResults);
    setIsProcessing(false);
    setProcessingComplete(true);

    // Save results to database
    if (selectedPatient) {
      saveResultsToDatabase(finalResults);
    }
  };

  const saveResultsToDatabase = async (resultData) => {
    try {
      const algorithmResult = {
        id: `alg_${Date.now()}_${selectedPatient.id}`,
        patientId: selectedPatient.id,
        patientName: selectedPatient.name,
        clinicId: selectedPatient.clinicId,
        clinicName: selectedPatient.clinicName,
        results: resultData,
        eyesOpenFile: eyesOpenFile?.name,
        eyesClosedFile: eyesClosedFile?.name,
        processedAt: new Date().toISOString(),
        processedBy: 'super_admin' // Could be dynamic based on logged-in user
      };

      await DatabaseService.create('algorithmResults', algorithmResult);
      toast.success('Results saved successfully!');

      // Reload history
      loadProcessingHistory(selectedPatient.id);
    } catch (error) {
      console.error('Error saving results:', error);
      toast.error('Failed to save results to database');
    }
  };

  const handleExecuteCalculation = () => {
    if (!selectedPatient) {
      toast.error('Please select a patient first');
      return;
    }
    if (eyesOpenFile && eyesClosedFile) {
      simulateProcessing();
    } else {
      toast.error('Please upload both QEEG data files');
    }
  };

  const handleExportResults = () => {
    if (results) {
      // Create CSV content
      const csvContent = [
        ['Parameter', 'Score (%)', 'Status'],
        ...results.map(r => [r.parameter, r.score, r.status])
      ].map(row => row.join(',')).join('\n');

      // Create and download file
      const blob = new Blob([csvContent], { type: 'text/csv' });
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = 'neurosense-algorithm-results.csv';
      a.click();
      window.URL.revokeObjectURL(url);
    }
  };

  const getStatusColor = (color) => {
    switch (color) {
      case 'blue': return 'text-primary';
      case 'orange': return 'text-orange-500';
      case 'red': return 'text-red-500';
      case 'green': return 'text-green-500';
      default: return 'text-gray-500';
    }
  };

  const getStatusBgColor = (status) => {
    if (status === 'Normal') return 'bg-green-100 text-green-800 dark:bg-green-900/30 dark:text-green-400';
    if (status === 'Elevated') return 'bg-orange-100 text-orange-800 dark:bg-orange-900/30 dark:text-orange-400';
    if (status === 'Abnormal') return 'bg-red-100 text-red-800 dark:bg-red-900/30 dark:text-red-400';
    return 'bg-gray-100 text-gray-800 dark:bg-gray-900/30 dark:text-gray-400';
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary mx-auto"></div>
          <p className="mt-4 text-gray-600 dark:text-gray-400">Loading patients...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="bg-gradient-to-r from-primary to-navy-700 rounded-lg p-6 text-white shadow-lg">
        <h1 className="text-2xl font-bold">NeuroSense - Algorithm 1 Data Processor</h1>
        <p className="text-primary-light mt-2">Upload QEEG data files and process them using Algorithm 1</p>
      </div>

      {/* Patient Selection */}
      <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm border border-gray-200 dark:border-gray-700 p-6">
        <h2 className="text-lg font-semibold text-gray-900 dark:text-white mb-4 flex items-center">
          <User className="h-5 w-5 mr-2" />
          Select Patient
        </h2>

        {!selectedPatient ? (
          <div>
            <div className="relative">
              <input
                type="text"
                placeholder="Search by patient name, email, or clinic..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-full px-4 py-2 border border-gray-300 dark:border-gray-600 rounded-lg bg-white dark:bg-gray-700 text-gray-900 dark:text-white focus:outline-none focus:ring-2 focus:ring-primary"
              />
            </div>

            {searchTerm && (
              <div className="mt-2 max-h-60 overflow-y-auto border border-gray-200 dark:border-gray-700 rounded-lg">
                {filteredPatients.length > 0 ? (
                  filteredPatients.map(patient => (
                    <div
                      key={patient.id}
                      onClick={() => handlePatientSelect(patient)}
                      className="p-3 hover:bg-gray-50 dark:hover:bg-gray-700 cursor-pointer border-b border-gray-100 dark:border-gray-700 last:border-b-0"
                    >
                      <div className="flex items-center justify-between">
                        <div>
                          <p className="font-medium text-gray-900 dark:text-white">{patient.name}</p>
                          <p className="text-sm text-gray-600 dark:text-gray-400">{patient.email}</p>
                        </div>
                        <div className="text-right">
                          <p className="text-sm text-gray-600 dark:text-gray-400 flex items-center">
                            <Building2 className="h-4 w-4 mr-1" />
                            {patient.clinicName}
                          </p>
                        </div>
                      </div>
                    </div>
                  ))
                ) : (
                  <div className="p-4 text-center text-gray-500 dark:text-gray-400">
                    No patients found
                  </div>
                )}
              </div>
            )}

            {!searchTerm && (
              <p className="text-sm text-gray-500 dark:text-gray-400 mt-2">
                Start typing to search for a patient...
              </p>
            )}
          </div>
        ) : (
          <div className="bg-accent-light dark:bg-primary/20 border border-primary-light dark:border-primary rounded-lg p-4">
            <div className="flex items-start justify-between">
              <div className="flex-1">
                <div className="flex items-center mb-2">
                  <User className="h-5 w-5 text-primary mr-2" />
                  <h3 className="text-lg font-semibold text-gray-900 dark:text-white">
                    {selectedPatient.name}
                  </h3>
                </div>
                <div className="space-y-1 text-sm">
                  <p className="text-gray-700 dark:text-gray-300 flex items-center">
                    <Building2 className="h-4 w-4 mr-2 text-primary" />
                    <span className="font-medium">Clinic:</span>
                    <span className="ml-2">{selectedPatient.clinicName}</span>
                  </p>
                  <p className="text-gray-700 dark:text-gray-300 flex items-center">
                    <Calendar className="h-4 w-4 mr-2 text-primary" />
                    <span className="font-medium">DOB:</span>
                    <span className="ml-2">{selectedPatient.dateOfBirth || 'N/A'}</span>
                  </p>
                  <p className="text-gray-700 dark:text-gray-300 flex items-center">
                    <History className="h-4 w-4 mr-2 text-primary" />
                    <span className="font-medium">Previous Scans:</span>
                    <span className="ml-2">{processingHistory.length}</span>
                  </p>
                </div>
              </div>
              <button
                onClick={handleClearSelection}
                className="text-gray-500 hover:text-red-600 dark:text-gray-400 dark:hover:text-red-400"
                title="Clear selection"
              >
                <X className="h-5 w-5" />
              </button>
            </div>
          </div>
        )}
      </div>

      {/* Main Content Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Left Panel - QEEG Data Input */}
        <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm border border-gray-200 dark:border-gray-700 p-6">
          <h2 className="text-lg font-semibold text-gray-900 dark:text-white mb-4">
            QEEG Data Input (Pages 13 & 24)
          </h2>

          {!selectedPatient ? (
            <div className="flex flex-col items-center justify-center py-12 text-center">
              <User className="h-16 w-16 text-gray-400 dark:text-gray-500 mb-4" />
              <p className="text-sm text-gray-600 dark:text-gray-400 font-medium">
                Please select a patient first
              </p>
              <p className="text-xs text-gray-500 dark:text-gray-500 mt-2">
                You need to select a patient before uploading QEEG data files
              </p>
            </div>
          ) : (
            <>
              {/* Eyes Open Upload */}
              <div className="mb-6">
                <label className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-2">
                  Page 13 (EO - Eyes Open)
                </label>
                <div className="relative border-2 border-dashed border-gray-300 dark:border-gray-600 rounded-lg p-6 text-center hover:border-primary dark:hover:border-primary-light transition-colors">
                  <input
                    type="file"
                    accept=".csv,.txt,.dat,.pdf"
                    onChange={(e) => handleFileUpload('eo', e)}
                    className="absolute inset-0 w-full h-full opacity-0 cursor-pointer"
                  />
                  <Upload className="h-12 w-12 text-gray-400 dark:text-gray-500 mx-auto mb-2" />
                  <p className="text-sm text-gray-600 dark:text-gray-400">
                    {eyesOpenFile ? eyesOpenFile.name : 'Drag & Drop or Click to Upload'}
                  </p>
                  {eyesOpenFile && (
                    <CheckCircle className="h-6 w-6 text-green-500 mx-auto mt-2" />
                  )}
                </div>
              </div>

              {/* Eyes Closed Upload */}
              <div className="mb-6">
                <label className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-2">
                  Page 24 (EC - Eyes Closed)
                </label>
                <div className="relative border-2 border-dashed border-gray-300 dark:border-gray-600 rounded-lg p-6 text-center hover:border-primary dark:hover:border-primary-light transition-colors">
                  <input
                    type="file"
                    accept=".csv,.txt,.dat,.pdf"
                    onChange={(e) => handleFileUpload('ec', e)}
                    className="absolute inset-0 w-full h-full opacity-0 cursor-pointer"
                  />
                  <Upload className="h-12 w-12 text-gray-400 dark:text-gray-500 mx-auto mb-2" />
                  <p className="text-sm text-gray-600 dark:text-gray-400">
                    {eyesClosedFile ? eyesClosedFile.name : 'Drag & Drop or Click to Upload'}
                  </p>
                  {eyesClosedFile && (
                    <CheckCircle className="h-6 w-6 text-green-500 mx-auto mt-2" />
                  )}
                </div>
              </div>
            </>
          )}

          {/* Data Loaded Progress */}
          <div>
            <label className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-2">
              Data Loaded
            </label>
            <div className="w-full bg-gray-200 dark:bg-gray-700 rounded-full h-2.5">
              <div
                className="bg-green-500 h-2.5 rounded-full transition-all duration-300"
                style={{ width: `${eyesOpenFile && eyesClosedFile ? 100 : eyesOpenFile || eyesClosedFile ? 50 : 0}%` }}
              ></div>
            </div>
          </div>
        </div>

        {/* Middle Panel - Algorithm Processing */}
        <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm border border-gray-200 dark:border-gray-700 p-6">
          <h2 className="text-lg font-semibold text-gray-900 dark:text-white mb-4">
            Algorithm 1 Processing
          </h2>

          {/* Execute Button */}
          <button
            onClick={handleExecuteCalculation}
            disabled={!eyesOpenFile || !eyesClosedFile || isProcessing}
            className={`w-full mb-6 py-3 px-4 rounded-lg font-medium flex items-center justify-center space-x-2 transition-colors shadow-md ${
              eyesOpenFile && eyesClosedFile && !isProcessing
                ? 'bg-primary hover:bg-navy-700 text-white'
                : 'bg-gray-300 dark:bg-gray-600 text-gray-500 dark:text-gray-400 cursor-not-allowed'
            }`}
          >
            <Play className="h-5 w-5" />
            <span>Execute Calculation</span>
          </button>

          {/* Processing Animation */}
          {isProcessing && (
            <div className="bg-gradient-to-r from-primary to-navy-700 rounded-lg p-6 text-center mb-6 shadow-lg">
              <div className="relative inline-block">
                <Activity className="h-16 w-16 text-white animate-pulse" />
                <div className="absolute inset-0 flex items-center justify-center">
                  <div className="w-20 h-20 border-4 border-white/30 border-t-white rounded-full animate-spin"></div>
                </div>
              </div>
              <p className="text-white font-medium mt-4">Processing...</p>
              <p className="text-primary-light text-sm">{consoleLog.length} actions done</p>
            </div>
          )}

          {/* Processing Complete */}
          {processingComplete && (
            <div className="bg-green-50 dark:bg-green-900/20 border border-green-200 dark:border-green-800 rounded-lg p-4 text-center mb-6">
              <CheckCircle className="h-12 w-12 text-green-500 mx-auto mb-2" />
              <p className="text-green-800 dark:text-green-400 font-medium">Processing Complete!</p>
            </div>
          )}

          {/* Console */}
          <div className="bg-gray-900 dark:bg-black rounded-lg p-4 min-h-[200px] max-h-[300px] overflow-y-auto">
            <div className="flex items-center justify-between mb-2 pb-2 border-b border-gray-700">
              <h3 className="text-sm font-medium text-gray-300">Console</h3>
              <button
                onClick={() => setConsoleLog([])}
                className="text-xs text-gray-400 hover:text-gray-200"
              >
                Clear
              </button>
            </div>
            <div className="space-y-1 font-mono text-xs">
              {consoleLog.length > 0 ? (
                consoleLog.map((log, index) => (
                  <div key={index} className="text-green-400">
                    &gt; {log}
                  </div>
                ))
              ) : (
                <div className="text-gray-500 italic">Console output will appear here...</div>
              )}
            </div>
          </div>
        </div>

        {/* Right Panel - Final 7 Parameter Scores */}
        <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm border border-gray-200 dark:border-gray-700 p-6">
          <h2 className="text-lg font-semibold text-gray-900 dark:text-white mb-4">
            Final 7 Parameter Scores
          </h2>

          {results ? (
            <>
              <div className="space-y-4 mb-6">
                {results.map((result, index) => (
                  <div key={index} className="border-b border-gray-200 dark:border-gray-700 pb-3">
                    <div className="flex items-center justify-between mb-1">
                      <span className="text-sm font-medium text-gray-700 dark:text-gray-300">
                        {result.parameter}
                      </span>
                      <span className={`text-sm font-bold ${getStatusColor(result.color)}`}>
                        {result.score}%
                      </span>
                    </div>
                    <div className="flex items-center justify-between">
                      <div className="flex-1 bg-gray-200 dark:bg-gray-700 rounded-full h-2 mr-3">
                        <div
                          className={`h-2 rounded-full ${
                            result.color === 'green' ? 'bg-green-500' :
                            result.color === 'blue' ? 'bg-primary' :
                            result.color === 'orange' ? 'bg-orange-500' :
                            'bg-red-500'
                          }`}
                          style={{ width: `${result.score}%` }}
                        ></div>
                      </div>
                      <span className={`text-xs px-2 py-1 rounded-full ${getStatusBgColor(result.status)}`}>
                        {result.status}
                      </span>
                    </div>
                  </div>
                ))}
              </div>

              {/* Export Button */}
              <button
                onClick={handleExportResults}
                className="w-full bg-green-600 hover:bg-green-700 text-white py-3 px-4 rounded-lg font-medium flex items-center justify-center space-x-2 transition-colors shadow-md"
              >
                <Download className="h-5 w-5" />
                <span>Export Results</span>
              </button>
            </>
          ) : (
            <div className="flex flex-col items-center justify-center py-12 text-center">
              <FileText className="h-16 w-16 text-gray-400 dark:text-gray-500 mb-4" />
              <p className="text-sm text-gray-600 dark:text-gray-400">
                Upload data files and execute calculation to see results
              </p>
            </div>
          )}
        </div>
      </div>

      {/* Info Section */}
      <div className="bg-accent-light dark:bg-primary/20 border border-primary-light dark:border-primary rounded-lg p-4 shadow-sm">
        <h3 className="text-sm font-medium text-primary dark:text-primary-light mb-2">
          About Algorithm 1 Processing
        </h3>
        <p className="text-sm text-navy-800 dark:text-gray-300">
          This processor analyzes QEEG data files (Eyes Open and Eyes Closed) and generates 7 key parameters using proprietary
          binary scoring logic. The algorithm evaluates brain activity patterns to assess cognitive and emotional health markers.
        </p>
      </div>
    </div>
  );
};

export default AlgorithmDataProcessor;

import React, { useState, useEffect } from 'react';
import { Upload, Play, Download, FileText, CheckCircle, Activity, User, Building2, Calendar, History, X } from 'lucide-react';
import DatabaseService from '../../services/databaseService';
import toast from 'react-hot-toast';

const AlgorithmDataProcessor = () => {
  const [patients, setPatients] = useState([]);
  const [selectedPatient, setSelectedPatient] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const [processingHistory, setProcessingHistory] = useState([]);
  const [loading, setLoading] = useState(true);

  const [eyesOpenFile, setEyesOpenFile] = useState(null);
  const [eyesClosedFile, setEyesClosedFile] = useState(null);
  const [isProcessing, setIsProcessing] = useState(false);
  const [processingComplete, setProcessingComplete] = useState(false);
  const [consoleLog, setConsoleLog] = useState([]);
  const [progress, setProgress] = useState(0);
  const [results, setResults] = useState(null);

  useEffect(() => {
    loadPatients();
  }, []);

  useEffect(() => {
    if (selectedPatient) {
      loadProcessingHistory(selectedPatient.id);
    }
  }, [selectedPatient]);

  const loadPatients = async () => {
    try {
      const patientsData = await DatabaseService.get('patients');
      const clinicsData = await DatabaseService.get('clinics');

      // Enrich patients with clinic names
      const enrichedPatients = patientsData.map(patient => ({
        ...patient,
        clinicName: clinicsData.find(c => c.id === patient.clinicId)?.name || 'Unknown Clinic'
      }));

      setPatients(enrichedPatients);
      setLoading(false);
    } catch (error) {
      console.error('Error loading patients:', error);
      toast.error('Failed to load patients');
      setLoading(false);
    }
  };

  const loadProcessingHistory = async (patientId) => {
    try {
      // Load algorithm results for this patient
      const results = await DatabaseService.get('algorithmResults');
      const patientResults = results.filter(r => r.patientId === patientId);
      setProcessingHistory(patientResults);
    } catch (error) {
      console.error('Error loading processing history:', error);
      setProcessingHistory([]);
    }
  };

  const handlePatientSelect = (patient) => {
    setSelectedPatient(patient);
    setSearchTerm('');
    // Reset upload states
    setEyesOpenFile(null);
    setEyesClosedFile(null);
    setResults(null);
    setProcessingComplete(false);
    setConsoleLog([]);
  };

  const handleClearSelection = () => {
    setSelectedPatient(null);
    setSearchTerm('');
    setEyesOpenFile(null);
    setEyesClosedFile(null);
    setResults(null);
    setProcessingComplete(false);
    setConsoleLog([]);
    setProcessingHistory([]);
  };

  const filteredPatients = patients.filter(patient =>
    patient.name?.toLowerCase().includes(searchTerm.toLowerCase()) ||
    patient.email?.toLowerCase().includes(searchTerm.toLowerCase()) ||
    patient.clinicName?.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleFileUpload = (type, event) => {
    const file = event.target.files[0];
    if (file) {
      if (type === 'eo') {
        setEyesOpenFile(file);
      } else {
        setEyesClosedFile(file);
      }
      // Reset processing state when new files are uploaded
      setProcessingComplete(false);
      setResults(null);
      setConsoleLog([]);
      setProgress(0);
    }
  };

  const simulateProcessing = async () => {
    setIsProcessing(true);
    setConsoleLog([]);
    setProgress(0);

    const steps = [
      { message: 'Parsing 2 activities...', delay: 800 },
      { message: 'Applying Binary Scoring Logic...', delay: 1000 },
      { message: 'Calculating Sub-Parameters...', delay: 1200 },
      { message: 'Decoding sub-parameters...', delay: 900 },
      { message: 'Finalizing Score...', delay: 1100 },
      { message: 'Applying Binary Scoring Logic...', delay: 800 }
    ];

    for (let i = 0; i < steps.length; i++) {
      await new Promise(resolve => setTimeout(resolve, steps[i].delay));
      setConsoleLog(prev => [...prev, steps[i].message]);
      setProgress(((i + 1) / steps.length) * 100);
    }

    // Generate results
    const finalResults = [
      { parameter: 'Focus & Attention', score: 88, status: 'Normal', color: 'blue' },
      { parameter: 'Stress', score: 67, status: 'Elevated', color: 'orange' },
      { parameter: 'Emotional Regulation', score: 45, status: 'Abnormal', color: 'red' },
      { parameter: 'Cognitive Flexibility', score: 90, status: 'Normal', color: 'green' },
      { parameter: 'Mood Stability', score: 78, status: 'Normal', color: 'green' },
      { parameter: 'Sleep Quality', score: 35, status: 'Abnormal', color: 'orange' },
      { parameter: 'Social Engagement', score: 82, status: 'Normal', color: 'green' }
    ];

    setResults(finalResults);
    setIsProcessing(false);
    setProcessingComplete(true);

    // Save results to database
    if (selectedPatient) {
      saveResultsToDatabase(finalResults);
    }
  };

  const saveResultsToDatabase = async (resultData) => {
    try {
      const algorithmResult = {
        id: `alg_${Date.now()}_${selectedPatient.id}`,
        patientId: selectedPatient.id,
        patientName: selectedPatient.name,
        clinicId: selectedPatient.clinicId,
        clinicName: selectedPatient.clinicName,
        results: resultData,
        eyesOpenFile: eyesOpenFile?.name,
        eyesClosedFile: eyesClosedFile?.name,
        processedAt: new Date().toISOString(),
        processedBy: 'super_admin' // Could be dynamic based on logged-in user
      };

      await DatabaseService.create('algorithmResults', algorithmResult);
      toast.success('Results saved successfully!');

      // Reload history
      loadProcessingHistory(selectedPatient.id);
    } catch (error) {
      console.error('Error saving results:', error);
      toast.error('Failed to save results to database');
    }
  };

  const handleExecuteCalculation = () => {
    if (!selectedPatient) {
      toast.error('Please select a patient first');
      return;
    }
    if (eyesOpenFile && eyesClosedFile) {
      simulateProcessing();
    } else {
      toast.error('Please upload both QEEG data files');
    }
  };

  const handleExportResults = () => {
    if (results) {
      // Create CSV content
      const csvContent = [
        ['Parameter', 'Score (%)', 'Status'],
        ...results.map(r => [r.parameter, r.score, r.status])
      ].map(row => row.join(',')).join('\n');

      // Create and download file
      const blob = new Blob([csvContent], { type: 'text/csv' });
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = 'neurosense-algorithm-results.csv';
      a.click();
      window.URL.revokeObjectURL(url);
    }
  };

  const getStatusColor = (color) => {
    switch (color) {
      case 'blue': return 'text-primary';
      case 'orange': return 'text-orange-500';
      case 'red': return 'text-red-500';
      case 'green': return 'text-green-500';
      default: return 'text-gray-500';
    }
  };

  const getStatusBgColor = (status) => {
    if (status === 'Normal') return 'bg-green-100 text-green-800 dark:bg-green-900/30 dark:text-green-400';
    if (status === 'Elevated') return 'bg-orange-100 text-orange-800 dark:bg-orange-900/30 dark:text-orange-400';
    if (status === 'Abnormal') return 'bg-red-100 text-red-800 dark:bg-red-900/30 dark:text-red-400';
    return 'bg-gray-100 text-gray-800 dark:bg-gray-900/30 dark:text-gray-400';
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary mx-auto"></div>
          <p className="mt-4 text-gray-600 dark:text-gray-400">Loading patients...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="bg-gradient-to-r from-primary to-navy-700 rounded-lg p-6 text-white shadow-lg">
        <h1 className="text-2xl font-bold">NeuroSense - Algorithm 1 Data Processor</h1>
        <p className="text-primary-light mt-2">Upload QEEG data files and process them using Algorithm 1</p>
      </div>

      {/* Patient Selection */}
      <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm border border-gray-200 dark:border-gray-700 p-6">
        <h2 className="text-lg font-semibold text-gray-900 dark:text-white mb-4 flex items-center">
          <User className="h-5 w-5 mr-2" />
          Select Patient
        </h2>

        {!selectedPatient ? (
          <div>
            <div className="relative">
              <input
                type="text"
                placeholder="Search by patient name, email, or clinic..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-full px-4 py-2 border border-gray-300 dark:border-gray-600 rounded-lg bg-white dark:bg-gray-700 text-gray-900 dark:text-white focus:outline-none focus:ring-2 focus:ring-primary"
              />
            </div>

            {searchTerm && (
              <div className="mt-2 max-h-60 overflow-y-auto border border-gray-200 dark:border-gray-700 rounded-lg">
                {filteredPatients.length > 0 ? (
                  filteredPatients.map(patient => (
                    <div
                      key={patient.id}
                      onClick={() => handlePatientSelect(patient)}
                      className="p-3 hover:bg-gray-50 dark:hover:bg-gray-700 cursor-pointer border-b border-gray-100 dark:border-gray-700 last:border-b-0"
                    >
                      <div className="flex items-center justify-between">
                        <div>
                          <p className="font-medium text-gray-900 dark:text-white">{patient.name}</p>
                          <p className="text-sm text-gray-600 dark:text-gray-400">{patient.email}</p>
                        </div>
                        <div className="text-right">
                          <p className="text-sm text-gray-600 dark:text-gray-400 flex items-center">
                            <Building2 className="h-4 w-4 mr-1" />
                            {patient.clinicName}
                          </p>
                        </div>
                      </div>
                    </div>
                  ))
                ) : (
                  <div className="p-4 text-center text-gray-500 dark:text-gray-400">
                    No patients found
                  </div>
                )}
              </div>
            )}

            {!searchTerm && (
              <p className="text-sm text-gray-500 dark:text-gray-400 mt-2">
                Start typing to search for a patient...
              </p>
            )}
          </div>
        ) : (
          <div className="bg-accent-light dark:bg-primary/20 border border-primary-light dark:border-primary rounded-lg p-4">
            <div className="flex items-start justify-between">
              <div className="flex-1">
                <div className="flex items-center mb-2">
                  <User className="h-5 w-5 text-primary mr-2" />
                  <h3 className="text-lg font-semibold text-gray-900 dark:text-white">
                    {selectedPatient.name}
                  </h3>
                </div>
                <div className="space-y-1 text-sm">
                  <p className="text-gray-700 dark:text-gray-300 flex items-center">
                    <Building2 className="h-4 w-4 mr-2 text-primary" />
                    <span className="font-medium">Clinic:</span>
                    <span className="ml-2">{selectedPatient.clinicName}</span>
                  </p>
                  <p className="text-gray-700 dark:text-gray-300 flex items-center">
                    <Calendar className="h-4 w-4 mr-2 text-primary" />
                    <span className="font-medium">DOB:</span>
                    <span className="ml-2">{selectedPatient.dateOfBirth || 'N/A'}</span>
                  </p>
                  <p className="text-gray-700 dark:text-gray-300 flex items-center">
                    <History className="h-4 w-4 mr-2 text-primary" />
                    <span className="font-medium">Previous Scans:</span>
                    <span className="ml-2">{processingHistory.length}</span>
                  </p>
                </div>
              </div>
              <button
                onClick={handleClearSelection}
                className="text-gray-500 hover:text-red-600 dark:text-gray-400 dark:hover:text-red-400"
                title="Clear selection"
              >
                <X className="h-5 w-5" />
              </button>
            </div>
          </div>
        )}
      </div>

      {/* Main Content Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Left Panel - QEEG Data Input */}
        <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm border border-gray-200 dark:border-gray-700 p-6">
          <h2 className="text-lg font-semibold text-gray-900 dark:text-white mb-4">
            QEEG Data Input (Pages 13 & 24)
          </h2>

          {!selectedPatient ? (
            <div className="flex flex-col items-center justify-center py-12 text-center">
              <User className="h-16 w-16 text-gray-400 dark:text-gray-500 mb-4" />
              <p className="text-sm text-gray-600 dark:text-gray-400 font-medium">
                Please select a patient first
              </p>
              <p className="text-xs text-gray-500 dark:text-gray-500 mt-2">
                You need to select a patient before uploading QEEG data files
              </p>
            </div>
          ) : (
            <>
              {/* Eyes Open Upload */}
              <div className="mb-6">
                <label className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-2">
                  Page 13 (EO - Eyes Open)
                </label>
                <div className="relative border-2 border-dashed border-gray-300 dark:border-gray-600 rounded-lg p-6 text-center hover:border-primary dark:hover:border-primary-light transition-colors">
                  <input
                    type="file"
                    accept=".csv,.txt,.dat,.pdf"
                    onChange={(e) => handleFileUpload('eo', e)}
                    className="absolute inset-0 w-full h-full opacity-0 cursor-pointer"
                  />
                  <Upload className="h-12 w-12 text-gray-400 dark:text-gray-500 mx-auto mb-2" />
                  <p className="text-sm text-gray-600 dark:text-gray-400">
                    {eyesOpenFile ? eyesOpenFile.name : 'Drag & Drop or Click to Upload'}
                  </p>
                  {eyesOpenFile && (
                    <CheckCircle className="h-6 w-6 text-green-500 mx-auto mt-2" />
                  )}
                </div>
              </div>

              {/* Eyes Closed Upload */}
              <div className="mb-6">
                <label className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-2">
                  Page 24 (EC - Eyes Closed)
                </label>
                <div className="relative border-2 border-dashed border-gray-300 dark:border-gray-600 rounded-lg p-6 text-center hover:border-primary dark:hover:border-primary-light transition-colors">
                  <input
                    type="file"
                    accept=".csv,.txt,.dat,.pdf"
                    onChange={(e) => handleFileUpload('ec', e)}
                    className="absolute inset-0 w-full h-full opacity-0 cursor-pointer"
                  />
                  <Upload className="h-12 w-12 text-gray-400 dark:text-gray-500 mx-auto mb-2" />
                  <p className="text-sm text-gray-600 dark:text-gray-400">
                    {eyesClosedFile ? eyesClosedFile.name : 'Drag & Drop or Click to Upload'}
                  </p>
                  {eyesClosedFile && (
                    <CheckCircle className="h-6 w-6 text-green-500 mx-auto mt-2" />
                  )}
                </div>
              </div>
            </>
          )}

          {/* Data Loaded Progress */}
          <div>
            <label className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-2">
              Data Loaded
            </label>
            <div className="w-full bg-gray-200 dark:bg-gray-700 rounded-full h-2.5">
              <div
                className="bg-green-500 h-2.5 rounded-full transition-all duration-300"
                style={{ width: `${eyesOpenFile && eyesClosedFile ? 100 : eyesOpenFile || eyesClosedFile ? 50 : 0}%` }}
              ></div>
            </div>
          </div>
        </div>

        {/* Middle Panel - Algorithm Processing */}
        <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm border border-gray-200 dark:border-gray-700 p-6">
          <h2 className="text-lg font-semibold text-gray-900 dark:text-white mb-4">
            Algorithm 1 Processing
          </h2>

          {/* Execute Button */}
          <button
            onClick={handleExecuteCalculation}
            disabled={!eyesOpenFile || !eyesClosedFile || isProcessing}
            className={`w-full mb-6 py-3 px-4 rounded-lg font-medium flex items-center justify-center space-x-2 transition-colors shadow-md ${
              eyesOpenFile && eyesClosedFile && !isProcessing
                ? 'bg-primary hover:bg-navy-700 text-white'
                : 'bg-gray-300 dark:bg-gray-600 text-gray-500 dark:text-gray-400 cursor-not-allowed'
            }`}
          >
            <Play className="h-5 w-5" />
            <span>Execute Calculation</span>
          </button>

          {/* Processing Animation */}
          {isProcessing && (
            <div className="bg-gradient-to-r from-primary to-navy-700 rounded-lg p-6 text-center mb-6 shadow-lg">
              <div className="relative inline-block">
                <Activity className="h-16 w-16 text-white animate-pulse" />
                <div className="absolute inset-0 flex items-center justify-center">
                  <div className="w-20 h-20 border-4 border-white/30 border-t-white rounded-full animate-spin"></div>
                </div>
              </div>
              <p className="text-white font-medium mt-4">Processing...</p>
              <p className="text-primary-light text-sm">{consoleLog.length} actions done</p>
            </div>
          )}

          {/* Processing Complete */}
          {processingComplete && (
            <div className="bg-green-50 dark:bg-green-900/20 border border-green-200 dark:border-green-800 rounded-lg p-4 text-center mb-6">
              <CheckCircle className="h-12 w-12 text-green-500 mx-auto mb-2" />
              <p className="text-green-800 dark:text-green-400 font-medium">Processing Complete!</p>
            </div>
          )}

          {/* Console */}
          <div className="bg-gray-900 dark:bg-black rounded-lg p-4 min-h-[200px] max-h-[300px] overflow-y-auto">
            <div className="flex items-center justify-between mb-2 pb-2 border-b border-gray-700">
              <h3 className="text-sm font-medium text-gray-300">Console</h3>
              <button
                onClick={() => setConsoleLog([])}
                className="text-xs text-gray-400 hover:text-gray-200"
              >
                Clear
              </button>
            </div>
            <div className="space-y-1 font-mono text-xs">
              {consoleLog.length > 0 ? (
                consoleLog.map((log, index) => (
                  <div key={index} className="text-green-400">
                    &gt; {log}
                  </div>
                ))
              ) : (
                <div className="text-gray-500 italic">Console output will appear here...</div>
              )}
            </div>
          </div>
        </div>

        {/* Right Panel - Final 7 Parameter Scores */}
        <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm border border-gray-200 dark:border-gray-700 p-6">
          <h2 className="text-lg font-semibold text-gray-900 dark:text-white mb-4">
            Final 7 Parameter Scores
          </h2>

          {results ? (
            <>
              <div className="space-y-4 mb-6">
                {results.map((result, index) => (
                  <div key={index} className="border-b border-gray-200 dark:border-gray-700 pb-3">
                    <div className="flex items-center justify-between mb-1">
                      <span className="text-sm font-medium text-gray-700 dark:text-gray-300">
                        {result.parameter}
                      </span>
                      <span className={`text-sm font-bold ${getStatusColor(result.color)}`}>
                        {result.score}%
                      </span>
                    </div>
                    <div className="flex items-center justify-between">
                      <div className="flex-1 bg-gray-200 dark:bg-gray-700 rounded-full h-2 mr-3">
                        <div
                          className={`h-2 rounded-full ${
                            result.color === 'green' ? 'bg-green-500' :
                            result.color === 'blue' ? 'bg-primary' :
                            result.color === 'orange' ? 'bg-orange-500' :
                            'bg-red-500'
                          }`}
                          style={{ width: `${result.score}%` }}
                        ></div>
                      </div>
                      <span className={`text-xs px-2 py-1 rounded-full ${getStatusBgColor(result.status)}`}>
                        {result.status}
                      </span>
                    </div>
                  </div>
                ))}
              </div>

              {/* Export Button */}
              <button
                onClick={handleExportResults}
                className="w-full bg-green-600 hover:bg-green-700 text-white py-3 px-4 rounded-lg font-medium flex items-center justify-center space-x-2 transition-colors shadow-md"
              >
                <Download className="h-5 w-5" />
                <span>Export Results</span>
              </button>
            </>
          ) : (
            <div className="flex flex-col items-center justify-center py-12 text-center">
              <FileText className="h-16 w-16 text-gray-400 dark:text-gray-500 mb-4" />
              <p className="text-sm text-gray-600 dark:text-gray-400">
                Upload data files and execute calculation to see results
              </p>
            </div>
          )}
        </div>
      </div>

      {/* Processing History */}
      {selectedPatient && processingHistory.length > 0 && (
        <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm border border-gray-200 dark:border-gray-700 p-6">
          <h2 className="text-lg font-semibold text-gray-900 dark:text-white mb-4 flex items-center">
            <History className="h-5 w-5 mr-2" />
            Processing History for {selectedPatient.name}
          </h2>
          <div className="space-y-3">
            {processingHistory.map((record, index) => (
              <div
                key={record.id}
                className="border border-gray-200 dark:border-gray-700 rounded-lg p-4 hover:bg-gray-50 dark:hover:bg-gray-700/50 transition-colors"
              >
                <div className="flex items-center justify-between">
                  <div className="flex-1">
                    <div className="flex items-center space-x-2 mb-2">
                      <Calendar className="h-4 w-4 text-primary" />
                      <span className="text-sm font-medium text-gray-900 dark:text-white">
                        {new Date(record.processedAt).toLocaleDateString('en-US', {
                          year: 'numeric',
                          month: 'short',
                          day: 'numeric',
                          hour: '2-digit',
                          minute: '2-digit'
                        })}
                      </span>
                    </div>
                    <div className="text-xs text-gray-600 dark:text-gray-400 space-y-1">
                      <p>Files: {record.eyesOpenFile}, {record.eyesClosedFile}</p>
                      <p>Processed by: {record.processedBy}</p>
                    </div>
                  </div>
                  <button
                    onClick={() => {
                      setResults(record.results);
                      setProcessingComplete(true);
                      toast.success('Previous results loaded');
                    }}
                    className="px-3 py-2 text-sm bg-primary hover:bg-navy-700 text-white rounded-lg transition-colors"
                  >
                    View Results
                  </button>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}

      {/* Info Section */}
      <div className="bg-accent-light dark:bg-primary/20 border border-primary-light dark:border-primary rounded-lg p-4 shadow-sm">
        <h3 className="text-sm font-medium text-primary dark:text-primary-light mb-2">
          About Algorithm 1 Processing
        </h3>
        <p className="text-sm text-navy-800 dark:text-gray-300">
          This processor analyzes QEEG data files (Eyes Open and Eyes Closed) and generates 7 key parameters using proprietary
          binary scoring logic. The algorithm evaluates brain activity patterns to assess cognitive and emotional health markers.
        </p>
      </div>
    </div>
  );
};

export default AlgorithmDataProcessor;

